import {RecipeModel} from './recipe.model';
import {EventEmitter, Injectable} from '@angular/core';
import {IngredientModel} from '../shared/ingredient.model';
import {ShoppinglistService} from '../shopping-list/shoppinglist.service';

@Injectable()
export class RecipeService {
  clickedRecipe = new EventEmitter<RecipeModel>();

  recipes: RecipeModel[] = [
    new RecipeModel('Dal Curry',
      'Asian curry which is a very tasteful dish common in every house',
      // tslint:disable-next-line:max-line-length
      'data:image/jpeg;base64,',
      [new IngredientModel('Dhal', 500), new IngredientModel('coconut', 1), new IngredientModel('water', 200)]
      ),
    new RecipeModel('Fruit Juice ', 'Healthy drink which is common in everywhere in the world',
      // tslint:disable-next-line:max-line-length
      'data:image/jpeg;base64,',
      [new IngredientModel('Mango', 1), new IngredientModel('Banana', 2), new IngredientModel('water', 200)])
  ];

  constructor(private shopService: ShoppinglistService) {
  }

  getAllRecipes() {
    return this.recipes.slice();
    // slice method return exact copy, without letting change object in service outside
  }

  addAllIngredients(ingredients: IngredientModel[]) {
    this.shopService.addIngredientArray(ingredients);
  }
}
